import React from "react";
import "./Toolbar.css";

const Toolbar = () => {
  return (
    <header className="Toolbar">
      <div>MENU</div>
      <div>LOGO</div>
      <nav>
        <ul>LINKS</ul>
      </nav>
    </header>
  );
};

export default Toolbar;
